import React from 'react'
import Navbar from "../components/Navbar";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';
import { styled } from '@mui/material/styles';
import TextField from "@mui/material/TextField";
import { Link } from "react-router-dom";
import Button from '@mui/material/Button';
import LockOpenIcon from '@mui/icons-material/LockOpen';
import PersonAddIcon from '@mui/icons-material/PersonAdd';

const ColorButton = styled(Button)(({ theme }) => ({
  color: theme.palette.getContrastText('#ffffff'),
  backgroundColor: "#ffffff",
  '&:hover': {
    backgroundColor: "#8C61FF",
  },
}));

const CssIFormControl = styled(FormControl)({
  '& label.Mui-focused': {
    color: 'white',
  },
  '& .MuiInput-underline:after': {
    borderBottomColor: 'black',
  },
  '& .MuiOutlinedInput-root': {
    '& fieldset': {
      borderColor: 'white',
    },
    '&:hover fieldset': {
      borderColor: 'yellow',
    },
    '&.Mui-focused fieldset': {
      borderColor: 'black',
    },
  },
});

const CssTextField = styled(TextField)({
  '& label.Mui-focused': {
    color: 'white',
  },
  '& .MuiInput-underline:after': {
    borderBottomColor: 'black',
  },
  '& .MuiOutlinedInput-root': {
    '& fieldset': {
      borderColor: 'white',
    },
    '&:hover fieldset': {
      borderColor: 'yellow',
    },
    '&.Mui-focused fieldset': {
      borderColor: 'black',
    },
  },
});

function PageSignUp() {

  const [rank, setRank] = React.useState('');

  const handleChange = (event) => {
    setRank(event.target.value);
  };


  return (
    <div>
        <Navbar />
        <Box sx={{height: '80vh',display: 'flex',justifyContent: 'center',alignItems:'center'}}>
            <Box sx={{ background: "#6592FD",width: "100%", maxWidth: 700,height: "100%",maxHeight: 500,top:'50%',left:'50%', borderRadius: "10px", borderStyle: "solid",}}>
                <Box sx={{textAlign: 'center',marginTop:'10px'}}>
                <Typography
              variant="subtitle1"
              sx={{ color: "#ffffff", fontWeight: "bold", fontSize: "24px" }}
            >
              Sign up
            </Typography>
                </Box>
                <Box sx={{display: "flex",justifyContent:'center',alignItems: 'center',flexDirection:'column'}}>
                <Box sx={{ minWidth: 600 }}>
                  <Box sx={{padding:'10px', width: "100%",}}>
                  <CssIFormControl fullWidth>
        <InputLabel id="demo-simple-select-label">ยศ</InputLabel>
        <Select
          labelId="demo-simple-select-label"
          id="demo-simple-select"
          value={rank}
          label="ยศ"
          onChange={handleChange}
        >
          <MenuItem value={10}>จ.ต.</MenuItem>
          <MenuItem value={20}>จ.ท.</MenuItem>
          <MenuItem value={30}>จ.อ.</MenuItem>
        </Select>
      </CssIFormControl>
                  </Box>

    </Box>
    <Box sx={{ minWidth: 600 ,display: "flex"}}>
    <Box sx={{padding:'10px', width: "50%",}}>
      <CssTextField fullWidth label="ชื่อ" id="fullWidth" />
      </Box>
      <Box sx={{padding:'10px', width: "50%",}}>
      <CssTextField fullWidth label="นามสกุล" id="fullWidth" />
      </Box>
    </Box>
    <Box sx={{ minWidth: 600 ,display: "flex"}}>
    <Box sx={{padding:'10px', width: "100%",}}>
      <CssTextField fullWidth label="RTAF-Email" id="fullWidth" placeholder='(ใส่ @ rtaf.mi.th)' />
      </Box>
    </Box>
    <Box sx={{ minWidth: 600 ,display: "flex"}}>
    <Box sx={{padding:'10px', width: "100%",}}>
      <CssTextField fullWidth label="กอง" id="fullWidth"  />
      </Box>
    </Box>
    <Box sx={{ minWidth: 600 ,display: "flex"}}>
    <Box sx={{padding:'10px', width: "50%",}}>
    <CssIFormControl fullWidth>
        <InputLabel id="demo-simple-select-label">แผนก</InputLabel>
        <Select
          labelId="demo-simple-select-label"
          id="demo-simple-select"
          value={rank}
          label="แผนก"
          onChange={handleChange}
        >
          <MenuItem value={10}>แผนกมาตรฐานซอฟต์แวร์</MenuItem>
          <MenuItem value={20}>แผนกวิเคราะห์และออกแบบซอฟต์แวร์</MenuItem>
        </Select>
      </CssIFormControl>
      </Box>
      <Box sx={{padding:'10px', width: "50%",}}>
      <CssTextField fullWidth label="สังกัด" id="fullWidth" />
      </Box>
    </Box>
    <Box sx={{display: "flex"}}>
                    <Box sx={{margin:'10px'}}>
                    <Link to="/PageHome" style={{ textDecoration: "none" }}>
                    <ColorButton startIcon={<LockOpenIcon />} variant="contained">Sign U</ColorButton>
                    </Link>
                    </Box>
                    <Box sx={{margin:'10px'}}>
                    <Link to="/PageSignUp" style={{ textDecoration: "none" }}>
                    <ColorButton startIcon={<PersonAddIcon />} variant="contained">Sign Up</ColorButton>
                    </Link>
                    </Box>
                </Box>
</Box>
            </Box>
        </Box>
    </div>
  )
}

export default PageSignUp
